const getHash256 = (a) => {
  return CryptoJS.SHA256(a)
};
async function getHmac512(str, secretKey){
    let secret = secretKey;
    let enc = new TextEncoder("utf-8");
    let body = str
    let algorithm = { name: "HMAC", hash: {name: "SHA-512"} };   
    let key = await crypto.subtle.importKey("raw", enc.encode(secret), algorithm, false, ["sign", "verify"]);
    let signature = await crypto.subtle.sign(algorithm.name, key, enc.encode(body));
    var b = new Uint8Array(signature);
    var str = Array.prototype.map.call(b, x => ('00'+x.toString(16)).slice(-2)).join("")
    return str;        
}

function getUrlSong(id) {
    let CTIME = Math.floor(Date.now() / 1000);
    return getHmac512(
      PATH_SONG + getHash256(`ctime=${CTIME}id=${id}version=${VERSION}`),
      SECRET_KEY
    )
    .then(signature_song => songUrl = `${unlockCors}${getUrlHaveCookie}?cookie=${zingCookieUrl}&url=${URL}${PATH_SONG}?id=${id}&ctime=${CTIME}&version=${VERSION}&sig=${signature_song}&apiKey=${API_KEY}`)
}
function getSong(id,callback){
    getUrlSong(id)
        .then(songUrl => {
            axios.get(`${songUrl}`)
                .then(res => callback(res.data))
        })
}
